import React, {useState, useEffect} from 'react'
import './bootstrap-5.2.1/dist/css/bootstrap.min.css';
import './jquery.js';
import './bootstrap-5.2.1/dist/js/bootstrap.min.js';

function Search(){
    const [data,setData]=useState([{}]);

    useEffect(()=>{
        fetch("/members").then(
            res=>res.json()
        ).then(
            data=>{   
                setData(data);
                console.log(data);
            }
        )
    },[])

    return (
        <>
            <div className="navbar bg-dark navbar-dark justify-content-center align-items-center d-flex">
                <div className="d-flex flex-row ">
                    <img className="mb-1 ms-3 " src={require("./pic/search.png")} alt="search"
                     width="30" height="30" type="submit"/>
                    <form class="col d-inline-flex ms-4 mb-3 " role="search">
                        <input class="form-control me-2 pb-2 d-flex " type="search" placeholder="Search" aria-label="Search"/>
                        <button class="btn btn-outline-success ms-3" type="submit">Search</button>
                    </form>
                </div>  
            </div>

            <div className="container d-flex justify-content-center">
                <div className="row row-cols-3">
                    {(typeof data.members==="undefined")?(
                        <p className="bg-success">Loding......</p>
                    ):(
                    data.members.map((member,i)=>(
                        <a className="col col-3 btn btn-primary d-block m-3 " key={i}
                        href="https://www.youtube.com/watch?v=13Dv9zvH4ko">{member}</a>
                    ))
                    )}
                </div>
            </div>
        </>
    )
    
}

export default Search;
